import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from './Home';
import QuoteForm from './QuoteForm';
import Preview from './Preview';
import QuotationCustoms from './QuotationCustoms';
import QuotationConsulting from './QuotationConsulting';
import QuotationFTA from './QuotationFTA';
import CustomsPreview from './customspreview';
import ConsultingPreview from './ConsultingPreview'; // ✅ 대소문자 정확히 맞춤

function App() {
  return (
    <BrowserRouter basename="/cv-react-quotation">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/form" element={<QuoteForm />} />
        <Route path="/preview" element={<Preview />} />
        <Route path="/customs" element={<QuotationCustoms />} />
        <Route path="/consulting" element={<QuotationConsulting />} />
        <Route path="/fta" element={<QuotationFTA />} />
        <Route path="/customspreview" element={<CustomsPreview />} />
<Route path="/consultingpreview" element={<ConsultingPreview />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
